import React,{useEffect ,useState} from "react";


export function Map(){
  useEffect(() => {
    const map = Map('map', {
      center: { lat: 28.612964, lng: 77.229463 },
    });

    map.addListener('click', function (e) {
      console.log(e.lngLat);
    });
  }, []);

  return <div id="map"></div>;
}
